import React, { useEffect, useRef } from "react";
import "../style.css";

const Map = () => {
  const containerRef = useRef(null);

  useEffect(() => {
    window.avSkymapProperties = {
      location: {
        lon: 30.524,
        lat: 50.450,
        name: "Kyiv",
        tz: "Europe/Kiev"
      },
      deco: 16399,
      size: 600,
      bgColor: "#ffffff",
      lang: "en"
    };
    const script = document.createElement("script");
    script.src = "https://www.astroviewer.net/widgets/widgets/skymap.js";
    script.async = true;
    containerRef.current.appendChild(script);

    return () => {
      delete window.avSkymapProperties;
      containerRef.current.innerHTML = "";
    };
  }, []);

  return <div id="av-skymap" ref={containerRef}></div>;
};

export default Map;
